(ns day7.core
  (:gen-class)
  (:require [clojure.string :as str]))

(defn- parse-line
  [line]
  (let [[name weight-str arrow & deps] (str/split line #"\s")
        weight (Integer/parseInt (str/replace weight-str #"[\(\)]" ""))
        deps (mapv #(str/replace % #"," "") deps)]
    {:name name
     :weight weight
     :deps deps}))

(defn- populate-has-parents-map
  [deps-map {:keys [name weight deps]}]
  (let [updated-deps-map (if (nil? (get deps-map name))
                          (assoc! deps-map name false)
                          deps-map)]
    (reduce (fn [deps-map dep] (assoc! deps-map dep true))
      updated-deps-map
      deps)))

(defn puzzle1
  [input]
  (let [has-parent-map (persistent! (reduce populate-has-parents-map
                                            (transient {})
                                            input))]
    (->> has-parent-map
      (filter #(false? (second %)))
      (map first)
      (first))))

(defn- obj-list->name-obj-map
  [input]
  (into {}
        (map (fn [x]
               [(:name x) x])
             input)))

(defn- construct-dep-tree
  [obj-map name]
  (let [curr-obj (get obj-map name)
        children (for [dep (:deps curr-obj)]
                   (construct-dep-tree obj-map dep))
        total-weight (+ (reduce + (map :total-weight children))
                        (:weight curr-obj))]
    (assoc curr-obj :children children
                    :total-weight total-weight)))

(defn- find-bad-child
  [node]
  (let [children (:children node)
        groups (group-by :total-weight children)
        groups-with-1-member (->> groups
                                  (map second)
                                  (filter #(= 1 (count %))))]
    (if (= (count groups-with-1-member) 1)
      (first (first groups-with-1-member))
      (throw (new VerifyError "Ah crap I need to actually write a proper algorithm instead of this hack"))))) ; Woohoo! I never needed to fix my hack!

(defn- find-proper-weight
  [node desired-weight]
  (- desired-weight
     (reduce + (map :total-weight (:children node)))))

(defn- find-bad-node-proper-weight
  [tree]
  (loop [node tree
         desired-weight nil]
    (let [children (:children node)]
      (if (apply = (map :total-weight children)) ; if all the children are balanced, this node is the problem
        (find-proper-weight node desired-weight)
        (let [bad-child (find-bad-child node)
              good-children (filter #(not= bad-child %) children)
              good-weight (:total-weight (first good-children))]
          (recur bad-child
                 good-weight))))))


(defn- puzzle2
  [input]
  (let [tree (construct-dep-tree (obj-list->name-obj-map input)
                                 (puzzle1 input))]
    (find-bad-node-proper-weight tree)))




